import * as React from 'react';
import './Home.css'
import CardStatus from '../components/Cards/CardStatus/Card';
import colors from '../components/ThemeColors/ThemeColors';
import CardNews from '../components/Cards/CardNews/CardNews';

export interface IHomeProps {
}

export default class Home extends React.Component<IHomeProps> {
  public render() {
    return (
      <div className='body-home px-5' data-spy='scroll'>
        <div className='status row'>
          <CardStatus color={colors.orange} linearGradient={[`${colors.orange} 50%`, `${colors.light_orange}`]} subtitle={'Clientes'} link={'/users'}/> 
          <CardStatus color={colors.red} subtitle={'Movimentações'} link={'/users'}></CardStatus>
          <CardStatus color={colors.green} subtitle={'Creditos'} link={'/users'}></CardStatus>
          <CardStatus color={colors.blue} subtitle={'Débitos'} link={'/users'}></CardStatus>
        </div>
        <CardNews></CardNews>


      </div>
    );
  }
}

